import React from 'react';
import { Link } from 'react-router-dom';
import Logo from '../../Assets/lp-logo.png';

export default function Landing() {
  return (
    <div>
      <div>
        <img src={Logo} />
        <Link to="/form">Click for form</Link>
      </div>
    </div>
  );
}
